import React from "react";
class Test1 extends React.Component {
  constructor() {
    super();
    this.state = { cshow: "None Component Showing" };
  }

  render() {
    return (
      <div>
        <div>
          Gill Telecom Service is professional Web design and Website
          development company in India that supplies services of web design and
          development, web application development, professional ecommerce
          online shopping systems, Flash multimedia, website hosting, search
          engine promotion (SEO), software development and graphics design. Gill
          Telecom Service features an integrated development and designing team
          of web consultants, creative designers, writers, programmers and
          marketing and SEO professionals that know how to get online results.
        </div>
      </div>
    );
  }
}

export default Test1;
